	_vpermj ymm1, ymm1  ; [1/a, ...]
	mov rax, 0BFF0000000000000h  ; -1.0
	vmovq xmm2, rax
	vfmadd231sd xmm2, xmm0, xmm1

	; xmm0: ln(a)
	_vpermk ymm0, ymm1  ; [ln(a), 0.0, 1/a, a]

	; xmm3: P(r) ~= ln(1 + r);
	;	Horner's method: degree 5 minimax polynomial
	vmovapd ymm3, ymmword ptr [coefs + (0)*32]
	_vpermj ymm1, ymm3
	vfmadd132sd xmm3, xmm1, xmm2
	_vpermk ymm1, ymm1
	vfmadd132sd xmm3, xmm1, xmm2
	_vpermj ymm1, ymm1
	vfmadd132sd xmm3, xmm1, xmm2

	; return ln(a) + P(r) ~= ln(x)
	vaddsd xmm0, xmm0, xmm3
	ret
